import React, { useState } from "react";
import Auth from "./Auth";
import App from "./App";

export default function Main() {
  const [user, setUser] = useState(null); // { email, passwordHash }

  return user ? (
    <App userEmail={user.email} passwordHash={user.passwordHash} />
  ) : (
    <Auth onLogin={setUser} />
  );
}
